import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import styles from '../styles/navbar.module.css';

function Navbar({ isAuthenticated, setIsAuthenticated}) {
    const navigate = useNavigate();

    const handleLogout = () => {
        setIsAuthenticated(false);
        navigate('/');
    };

    return (
        <nav className={styles.navbar}>
            {isAuthenticated && (
                <>
                    <li><Link to="/missing-persons" className={styles.navLink}>Missing Persons</Link></li>
                    <li><Link to="/missing-persons/reported-persons" className={styles.navLink}>Reported Persons</Link></li>
                    <li><Link to="/missing-persons/add" className={styles.navLink}>Add Missing Person</Link></li>
                    <li><Link to="/matched-persons">Matched Persons</Link></li>
                    <li><Link to="/profile">Profile</Link></li>

                    <button onClick={handleLogout} className={styles.navButton}>Logout</button>
                </>
            )}
        </nav>
    );
}

export default Navbar;
